import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <form>
      <h1>Hello</h1>

      <label> Enter Name Here: <input type='text' name='name'/></label>
      </form>
    </div>
  );
}
export default App;
